import React from 'react';
import { WiDayCloudyGusts } from "react-icons/wi";

function Navbar() {

    return (
        <div className="flex flex-row items-center justify-between font-mono text-stone-200 bg-header-primary text-sm md:text-md
         xl:p-4">
            <div className='flex flex-row justify-between items-center p-1'>
                <WiDayCloudyGusts size={60} className="animate-pulse ease-in-out" />
                <span className='font-semibold tracking-wider'>&nbsp;Daily Weather</span>
            </div>
            <div className="text-center cursor-pointer tracking-tighter p-1">
                {new Date().toDateString()}
            </div>
        </div>
    )
}

export default Navbar
